import {rose} from '../images/rose';
// import kociak from "../images/kociak";

const k = require("../images/kociak")


export const Niespodzianka = () => {
  return (
    <div>
      <h1 style={{textAlign: "center", color: "crimson"}}> Dla Oli</h1>
      <img src={k}/>
      <img src={rose}/>
    </div>
  )
}
